function Button_1(props) {
  const { innerText } = props;

  return (
    <div>
      {currentTheme.theme == "dark" && (
        <button className="btn_1_dark           ">{innerText}</button>
      )}
      {currentTheme.theme == "light" && (
        <button className="btn_1_light           ">{innerText}</button>
      )}
    </div>
  );
}

